import  MenuItem  from '../MenuItem/MenuItem';
import React from 'react';
import "./style.css";
class Menu extends React.Component {
    
    render() {
        return (
            <>
                <ul className="list">
                    {this.props.list1.map(item => (
                        <>
                            <MenuItem key={item.id} item={item} />
                        </>
                    ))}
                </ul>
                
            </>
        );
    }
}

export default Menu;
